def fix_spaces(text):
    result = []
    consecutive_spaces = 0
    for char in text:
        if char == ' ':
            consecutive_spaces += 1
            if consecutive_spaces > 2:
                result.append('-')
        else:
            if consecutive_spaces > 2:
                result.append('-')
            elif consecutive_spaces > 0:
                result.append('_')
            result.append(char)
            consecutive_spaces = 0
    if consecutive_spaces > 2:
        result.append('-')
    elif consecutive_spaces > 0:
        result.append('_')
    return ''.join(result)

