def do_algebra(operators, operands):
    result = operands[0]
    for i in range(1, len(operands)):
        if operators[i-1] == '+':
            result += operands[i]
        elif operators[i-1] == '-':
            result -= operands[i]
        elif operators[i-1] == '*':
            result *= operands[i]
        elif operators[i-1] == '//':
            result //= operands[i]
        elif operators[i-1] == '**':
            result **= operands[i]
    return result

